window.bookSummaryJSON = "<p><b>Construct your dungeon. Summon your monster girls. Slaughter your foes.</b><br> &nbsp;</p> <p>When the Inkolana Cartel's experimental computer network comes under attack, they give white-hat hacker Clay Knight two hours to fix the problem.<br> &nbsp;</p> <p>If he succeeds, he'll be rich beyond his wildest dreams.<br> &nbsp;</p> <p>If he fails, he's a dead man.<br> &nbsp;</p> <p>But when Clay hacks the hackers, he stumbles into an ancient ritual that summons him to the dusty, forgotten world of Soketra. In this strange new land, Clay finds dungeons, monsters, and a fierce pride of beautiful cat women who believe he is the reincarnation of the ancient Dungeon Lord Rathokhetra. With a band of bloodthirsty dungeon raiders on his doorstep, Clay must master his new abilities and gather guardians for his territory to save himself and his army of warrior women from a fate darker than death.</p>"; 
